import React from "react";
import bgimg7 from "../../image/bgimg7.jpg";
import { Card } from "react-bootstrap";

export default function Footer() {
  return (
    <Card className="text-white" style={{ width: "100%" }}>
      <Card.Img
        src={bgimg7}
        alt="Card image"
        style={{ height: "500px", width: "100%" }}
      />
      <Card.ImgOverlay>
        <Card.Title>
          <h1>iPicXel</h1>
        </Card.Title>

        <Card.Text>
          <h3>
            Address: SriRam Summit Wing:3, 3rd Floor Electronic City Phase 1,
            Bengaluru, Karnatakta-560100
          </h3>
        </Card.Text>
        <Card.Text>
          <p>All the copyright reserved to the @ wittymindstechnologies.</p>
        </Card.Text>
      </Card.ImgOverlay>
    </Card>
  );
}
